import "./AUstyles.css";

function AboutUsPage(){
    return(
        <div className = "about-container">
            <h1>Our History</h1>
            <p>Our journey began with a vision of change. Founded in 2023, our NGO has since evolved, tirelessly striving to create a positive impact. Over the years, we've transformed countless lives through various initiatives, from education to healthcare. Our history is a testament to our unwavering commitment to building a more equitable world, one life at a time.</p>
            
            <h1>Mission</h1>
            <p>Our mission is to empower underserved communities by providing access to education, healthcare, and vital resources. We're dedicated to breaking the cycle of poverty and creating a brighter, more equitable world. With a focus on sustainable change and individual dignity, we work tirelessly to uplift lives and foster a global community of support and empathy</p>
            
            <h1>Vision</h1>
            <p>Our vision is a world where every individual, regardless of their circumstances, has the opportunity to thrive and fulfill their potential. We aspire to create a future where poverty, inequality, and lack of access to education and healthcare are replaced with empowerment, equality, and a sense of shared humanity. Together, we strive to make this vision a reality.</p>
        </div>
    )
}

export default Visualize;
